import "./styles.css";
import React ,{Component} from 'react';
import { BrowserRouter, Routes, Link, Route } from 'react-router-dom';
import Home from './components/home';

const App =()=> {
  return (
    <div className="App">
      <BrowserRouter>
      <Routes>
        <Route path={"/"} render={()=><Home / >}/>
      </Routes>
      </BrowserRouter>
      </div>
  ); 
}

export default App;
